import React from "react";
import styled from "styled-components";

const links = [
  "Lifestyle",
  "Jordan",
  "Running",
  "Basketball",
  "Traning & Gym",
  "Football",
  "Skateboarding",
  "American Football",
  "Baseball",
  "Golf",
  "Tennis",
  "Athletics",
  "Walinkg",
];

const SidebarMenu = ({ props, selected = "Running" }) => {
  return (
    <>
      <div>{"TOZ"}</div>
      <ol>
        {links.map((link) => {
          <li
            style={{
              "--selected": selected === link ? selected : undefined,
            }}
          >
            {link}
          </li>;
        })}
      </ol>
    </>
  );
};

const Wrapper = styled.div``;

export default SidebarMenu;
